// src/pages/Configuracion.js
import React from 'react';
import '../styles/Configuracion.css';
import userImage from '../assets/user.png'; // Imagen de perfil predeterminada
import { useNavigate } from 'react-router-dom';

function Configuracion({ user }) {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Lógica para cerrar sesión (puedes añadir lógica específica aquí)
    navigate('/');
  };

  return (
    <div className="config-container">
      <img src={user?.picture || userImage} alt="User" className="user-image" />
      <h2 className="user-name">{user?.name || "Usuario"}</h2>
      <p className="user-email">{user?.email || "correo@dominio.com"}</p>
      <button className="logout-button" onClick={handleLogout}>
        Cerrar Sesión
      </button>
    </div>
  );
}

export default Configuracion;
